import Axios from "axios";
import { CAR_MODEL_LIST_REQUEST, CAR_MODEL_LIST_SUCCESS, CAR_MODEL_LIST_FAIL } from "../constants/carConstants"

export const modelCars = () => async (dispatch) => {
    dispatch({
        type: CAR_MODEL_LIST_REQUEST
    });
    try {
        const { data } = await Axios({
            method: 'GET',
            url: 'http://165.227.108.163:5050/cars/get_all_makes/',
        })
        dispatch({type: CAR_MODEL_LIST_SUCCESS, payload: data})
    } catch(error) {
        dispatch({type: CAR_MODEL_LIST_FAIL, payload: error.message});
    }
}
